result:
.container {
  padding: 6px;

  .info {
    height: 80px;

    .label {
      margin-left: 10px
    }

    .run-button {
      width: 100%;
      height: 40px;
      font-size: 120%;
    }
  }

  .result {
    min-height: 600px;
    margin-top: 6px;
    display: flex;
    flex-direction: column;

    .case-choose {
      display: flex;
      justify-content: space-between;
      margin-bottom: 5px;

      .title {
        color: $parent-title-color;
        font-size: 1.1em;
        font-weight: 500;
      }
    }

    .case-info {
      display: flex;

      .statistical {
        display: flex;
        flex-direction: column;
        width: 40%;

        .ring-card {
          height: 240px;

          .ring {
            transform: translateY(-90px);
          }
        }

        .case-list {
          margin-top: 10px;
          height: 300px;

          .case-title {
            height: 30px;
            width: 98%;
            border:1px solid #b3d8ff;
            margin-bottom: 6px;
            display: flex;
            align-items: center;

            .icon {
              margin-left: 10px;
            }

            .title {
              margin-left: 10px;
            }
          }

          .case-title-normal {
            @extend .case-title;
            color: #409EFF;
            background: #ecf5ff;
          }

          .case-title-normal:hover {
            border: 1px solid #409EFF;
          }

          .case-title-choose{
            @extend .case-title;
            color: #ecf5ff;
            background: #409EFF;
          }
        }
      }

      .case-detail {
        margin-left: 10px;
        width: 60%;
        height: 600px;

        .table {
          height: 200px;
        }

        .detail {
          margin-top: 10px;
          height: 340px;

          .header {
            display: flex;
            align-items: flex-end;
            justify-content: space-between;

            .title {
              color: $parent-title-color;
              font-size: 20px;
              font-weight: 500;
            }
          }

          .table {
            margin-top: 10px;
            height: 100%;
          }

          .response-text {
            margin-top: 10px;
            word-wrap: break-word;
            word-break: normal;
          }
        }

      }
    }

  }
}
